# this code was used to acquire plugin parameter names/numbers and store them in a dictionary
# assign this function to a button and with the plugin you want to get the data from focused, push it and the data will appear in the script output

def store_plugin_data():
	print('plugin param storage')
	plug_dict = {}
	count = plugins.getParamCount(channels.selectedChannel())
	store = []
	num_list = [i for i in range(0, count + 1)]
		    
	for i in range(count):
		name = plugins.getParamName(i, channels.selectedChannel())
		store.append(name)
		    
	# print(store)
	# plug_dict = dict(list(enumerate(store))) 	# name as value - or -
	plug_dict = dict(zip(store, num_list)) 		# name as key 
	print(plug_dict)

